import React from 'react';
import {Link} from 'react-router-dom';
import logo from '../../assets/images/ROMI.png';
import bottleHolders from '../../imgs/bottleHolders';
import lunchBoxes from '../../imgs/lunchboxes';
import makeupBags from '../../imgs/makeupBags';
import pencilCases from '../../imgs/pencilcases';

const Header = (props)=>{
    return(
        <section className="header">
            <h1 >Accesorios personalizados</h1>
            <div className = "logo">
            <img src={logo} className= "logo-image"></img>
            </div>
              <div className="categories" >

                <span><Link to="/loncheras">Loncheras</Link></span>
                •
                <span><Link to="/estucheras">Estucheras</Link></span>
                •
                <span><Link to="/cosmetiqueras">Cosmetiqueras</Link></span>
                •
                <span><Link to="/portabotellas">Portabotellas</Link></span>
              </div>
        </section>
      );
}

export default Header;
